import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap'



class App extends Component {

  render() {
    return (

          <div class="container">

                         <Entrada />

          </div>      

    )
  }
}


class Entrada extends Component{
   render(){
      return ( 
          <div>
            <input type="text" name="entrada"/>
          </div>
      )
   }
}

export default App;
